import React from 'react';
import Navbar from 'react-bootstrap/Navbar';

class Head extends React.Component {
    render(){
        return (
                <Navbar expand="md" bg="light" fixed="top">                    
                        <Navbar.Brand href="">
                            NITRAA | PUNE
                        </Navbar.Brand>
                </Navbar>
        );
    }
}

export default Head;
